        .withMatcher("upAdcd",ExampleMatcher.GenericPropertyMatchers.exact())
        .withMatcher("isEnab",ExampleMatcher.GenericPropertyMatchers.exact());
    Example<ObjAd> example = Example.of(objAd ,matcher);
    //排序
    Sort sort =  Sort.by(Sort.Direction.ASC,"adcd");
    return this.getList(example,sort);
