CREATE DEFINER=`lanling_dev`@`%` PROCEDURE `UpdateSupplierGradeForTwoPeriods`()
BEGIN
    -- 在事务块外创建临时表
    CREATE TEMPORARY TABLE IF NOT EXISTS supplier_grade_first_period (
        fd_id VARCHAR(255)
    );
    CREATE TEMPORARY TABLE IF NOT EXISTS supplier_grade_second_period (
        fd_id VARCHAR(255)
    );
    CREATE TEMPORARY TABLE IF NOT EXISTS supplier_grade_intersection (
        fd_id VARCHAR(255)
    );

    START TRANSACTION;

    -- 以下是您的业务逻辑代码
    -- 两年内未发生1次采购的，转为合格供应商。
    UPDATE bmp_supmdm_main a LEFT JOIN bmp_purmd_review c ON a.fd_id = c.fd_supplier_id AND c.doc_status = '30' AND c.doc_create_time >= DATE_SUB( CURDATE(), INTERVAL 2 YEAR ) 
    SET a.fd_sup_grade = '2',
    a.ud_grade_records = CONCAT( IFNULL(a.ud_grade_records,''), '\n', DATE_FORMAT( CURDATE(), '%Y-%m-%d' ), ':供应商两年内未采购从优秀降级为合格' ) 
    WHERE a.doc_status = '30' AND a.doc_template_id = '181370a34bc6788dce6b3e74d368fdac' AND a.fd_sup_grade = '3' AND c.fd_id IS NULL;

    -- 插入第一周期的数据
    INSERT INTO supplier_grade_first_period (fd_id)
    SELECT a.fd_id
    FROM bmp_supmdm_main a
    INNER JOIN bmp_purmd_review c ON a.fd_id = c.fd_supplier_id AND c.doc_status = '30' AND c.doc_create_time >= DATE_SUB(CURDATE(), INTERVAL 1 YEAR)
    INNER JOIN bmp_purmd_accep_appr b ON b.fd_cgps_id = c.fd_id AND b.doc_status = '30' AND b.fd_total_point < 85
    WHERE a.doc_status = '30' AND a.doc_template_id = '181370a34bc6788dce6b3e74d368fdac' AND a.fd_sup_grade = '3'
    GROUP BY a.fd_id;

    -- 插入第二周期的数据
    INSERT INTO supplier_grade_second_period (fd_id)
    SELECT a.fd_id
    FROM bmp_supmdm_main a
    INNER JOIN bmp_purmd_review c ON a.fd_id = c.fd_supplier_id AND c.doc_status = '30' AND c.doc_create_time BETWEEN DATE_SUB(CURDATE(), INTERVAL 2 YEAR) AND DATE_SUB(CURDATE(), INTERVAL 1 YEAR)
    INNER JOIN bmp_purmd_accep_appr b ON b.fd_cgps_id = c.fd_id AND b.doc_status = '30' AND b.fd_total_point < 85
    WHERE a.doc_status = '30' AND a.doc_template_id = '181370a34bc6788dce6b3e74d368fdac' AND a.fd_sup_grade = '3'
    GROUP BY a.fd_id;

    INSERT INTO supplier_grade_intersection (fd_id)
    SELECT fp.fd_id
    FROM supplier_grade_first_period fp
    INNER JOIN supplier_grade_second_period sp ON fp.fd_id = sp.fd_id;

    -- 更新供应商等级
    UPDATE bmp_supmdm_main a
    SET a.fd_sup_grade = '2',
    a.ud_grade_records = CONCAT(IFNULL(a.ud_grade_records,''), '\n', DATE_FORMAT(CURDATE(), '%Y-%m-%d'), ':连续两次周期内综合评价都在85分以下从优秀降级为合格')
    WHERE a.fd_id IN (SELECT fd_id FROM supplier_grade_intersection);
	  -- 返回受影响的行数
    SELECT ROW_COUNT();
    COMMIT;


    -- 删除临时表
    DROP TEMPORARY TABLE supplier_grade_first_period;
    DROP TEMPORARY TABLE supplier_grade_second_period;
    DROP TEMPORARY TABLE supplier_grade_intersection;
END


执行存储过程出现Statement violates GTID consistency: CREATE TEMPORARY TABLE and DROP TEMPORARY TABLE can only be executed outside transactional context.  These statements are also not allowed in a function or trigger because functions and triggers are also considered to be multi-statement transactions.
